function mp_settings_accordion_start(){var t,s=document.getElementsByClassName("mp-settings-title-align");for(t=0;t<s.length;t++)s[t].addEventListener("click",(function(){this.classList.toggle("active");var t=null;console.log(this.childNodes);for(var s=0;s<this.childNodes.length;s++)if(this.childNodes[s]?.classList?.contains("mp-settings-margin-left")){t=this.childNodes[s];break}t.childNodes[1].classList.toggle("mp-arrow-up");var i=this.nextElementSibling;"block"===i.style.display?i.style.display="none":i.style.display="block"}));console.log("MP Settings Accordion Started!")}window.addEventListener("load",(function(){mp_settings_accordion_start()}));